define([], function () {
  //  Constructor
  var OMValidatorResponse = function () {
    //  Private Variable Declarations -------------------------------------
    var _accountDataList = null;
    var _commonData = null; //  Privileged Method Declarations ------------------------------------

    this.getAccountDataList = function () {
      return _accountDataList;
    };

    this.setAccountDataList = function (lad) {
      _accountDataList = lad;
    };

    this.getCommonData = function () {
      return _commonData;
    };

    this.setCommonData = function (cd) {
      _commonData = cd;
    };

    this.isValid = function () {
      var r = true;
      var aList = this.getAccountDataList();

      for (var i = 0; i < aList.length; i++) {
        var ad = aList[i];
        if (ad.getErrorCode() === 0) r = false;
      }

      return r;
    };
  };

  return OMValidatorResponse;
});
